import React from 'react';
import { StyledSideBar, StyledLink, StyledExangeIcon } from './styles';

function SideBar() {
    return (
        <StyledSideBar>
            <nav>
                <ul>
                    <li>
                        <StyledLink to="/">
                            Home <StyledExangeIcon />
                        </StyledLink>
                        <StyledLink to="/transactions">
                            Transactions <StyledExangeIcon />
                        </StyledLink>
                    </li>
                </ul>
            </nav>
        </StyledSideBar>
    );
}

export default SideBar;
